// SearchComponent.jsx
import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function FindComponent() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);
  const [page, setPage] = useState(1);
  const [hasMore, setHasMore] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Fetch data whenever query or page changes
  useEffect(() => {
    if (!query.trim()) {
      setResults([]);
      setHasMore(false);
      return;
    }

    setLoading(true);
    setError(null);

    const params = new URLSearchParams({ search: query + '%' });
    fetch(`http://127.0.0.1:5000/find/${page}?${params}`)
      .then(res => res.json())
      .then(data => {
        if (data.error) {
          setError(data.error);
          setResults([]);
          setHasMore(false);
        } else {
          setResults(data.results);
          setHasMore(data.hasMore);
        }
      })
      .catch(err => {
        console.error(err);
        setError('Network error');
        setResults([]);
        setHasMore(false);
      })
      .finally(() => setLoading(false));
  }, [query, page]);

  // Reset to page 1 on new query
  useEffect(() => {
    setPage(1);
  }, [query]);

  return (
    <div className="container py-5">
      <h2 className="mb-4 text-center">Ultimate Certamen Search</h2>

      {/* Search Bar */}
      <form
        className="row g-3 align-items-end justify-content-center mb-4"
        onSubmit={e => e.preventDefault()}
      >
        <div className="col-sm-6">
          <label htmlFor="search-input" className="form-label visually-hidden">
            Search
          </label>
          <input
            type="text"
            id="search-input"
            className="form-control"
            placeholder="Enter keyword..."
            value={query}
            onChange={e => setQuery(e.target.value)}
            disabled={loading}
          />
        </div>
        <div className="col-sm-2 d-grid">
          <button
            type="button"
            className="btn btn-primary"
            onClick={() => setPage(1)}
            disabled={loading || !query.trim()}
          >
            {loading ? 'Searching...' : 'Search'}
          </button>
        </div>
      </form>

      {error && <div className="alert alert-danger">{error}</div>}

      {/* Results Table */}
      <div className="table-responsive mb-3">
        <table className="table table-striped table-hover align-middle">
          <thead className="table-dark">
            <tr>
              <th>Tournament</th>
              <th>Level</th>
              <th>Year</th>
              <th>Snippet</th>
            </tr>
          </thead>
          <tbody>
            {results.length > 0 ? (
              results.map((r, idx) => (
                <tr key={idx} style={{ cursor: 'pointer' }}>
                  <td>{r.tournament}</td>
                  <td>{r.level}</td>
                  <td>{r.year}</td>
                  <td>{r.snippet}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4" className="text-center py-4">
                  {loading ? 'Loading...' : 'No results found.'}
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      {/* Pagination Controls */}
      {results.length > 0 && (
        <div className="d-flex justify-content-between">
          <button
            className="btn btn-outline-primary"
            onClick={() => setPage(p => Math.max(1, p - 1))}
            disabled={page === 1 || loading}
          >
            ← Previous
          </button>

          <span className="align-self-center">Page {page}</span>

          <button
            className="btn btn-outline-primary"
            onClick={() => setPage(p => p + 1)}
            disabled={!hasMore || loading}
          >
            Next →
          </button>
        </div>
      )}
    </div>
  );
}

export default FindComponent;
